CREATE TABLE IF NOT EXISTS Users (userId INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, email VARCHAR(50), profile_picture VARCHAR(50), username VARCHAR(50), password VARCHAR(50), firstName VARCHAR(50), lastLame VARCHAR(50), gender VARCHAR(50), birthdate DATE, country VARCHAR(50), city VARCHAR(50), state VARCHAR(50));
CREATE TABLE IF NOT EXISTS Todos (taskId INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,taskName VARCHAR(255),description TEXT, userId INTEGER, FOREIGN KEY (userId) REFERENCES Users(userId));